import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './pages/Login';
import StudentHome from './pages/StudentHome'; // We will create this next
import AdminPanel from './pages/AdminPanel';   // We will create this next

function App() {
  return (
    <Router>
      <Routes>
        {/* The Entry Point */}
        <Route path="/" element={<Login />} />
        
        {/* The Destinations */}
        <Route path="/home" element={<StudentHome />} />
        <Route path="/admin" element={<AdminPanel />} />
      </Routes>
    </Router>
  );
}

export default App;
